import React, { useEffect, useState } from 'react';
import Card from './card'

const Home = () => {
  const [data, setData] = useState([])
  useEffect(() => {
    fetch('/allpost', {
      headers: {
        "Authorization": "Bearer " + localStorage.getItem("jwt")
      }
    }).then(res=>res.json())
    .then(result=>{
      console.log(result.post)
    })
  }, [])
  return (
    <>
      <Card />
    </>
  );
}

export default Home;
